  const [data, setData] = useState()
  useEffect(() => {
    fetch(
      "https://fitness-calculator.p.rapidapi.com/bmi?age=25&height=180&weight=65",
      {
        method: "GET",
        headers: {
          "x-rapidapi-host": "fitness-calculator.p.rapidapi.com",
          "x-rapidapi-key":
            "adf0ea3817msh93d3df2122cf860p158840jsn5320d164d6d5",
        },
      }
    )
      .then((response) => response.json())
      .then((response) => {
        setData(response)
      })
      .catch((err) => {
        console.log(err)
      })
  }, [])

  return (
    <div id="BMI">
